//To run unit tests
//npm install --save blocx-react-components
import renderer from 'react-test-renderer';
import React from 'react';
import { configure } from 'enzyme';
import { shallow, mount } from 'enzyme';
import Adapter from 'enzyme-adapter-react-16';
import {BlocxChips} from 'blocx-react-components';

configure({adapter: new Adapter()});

describe('<BlocxChips />', function () {

    let items = [
        {"id":"0","value": "HTML", "imgPath":"data:image/png;base64,"},
        {"id":"1","value": "CSS", "imgPath":"data:image/png;base64,"},
        {"id":"2","value": "PHP", "imgPath":"data:image/png;base64,"},
        {"id":"3","value": "Javascript", "imgPath":"data:image/png;base64,"},
        {"id":"4","value": "bike","imgPath":"data:image/jpeg;base64,"},
        {"id":"5","value": "coffee","imgPath":"data:image/png;base64,"},
        {"id":"6","value": "tea","imgPath":"data:image/png;base64,"},
        {"id":"7","value": "portland","imgPath":"data:image/png;base64,"},
        {"id":"8","value": "love","imgPath":"data:image/jpeg;base64,"},
        {"id":"9","value": "react", "imgPath":"data:image/png;base64,"}
    ]

    let chips1 = ['react', 'javascript', 'scss']

    it('renders correctly [BlocxChips Variant 1]', function () {
        const wrapper = renderer.create(<BlocxChips  value={['react', 'javascript', 'scss']}
        placeholder="Add a tag..."
        data={items}
        type="Input"/>).toJSON();
        expect(wrapper).toMatchSnapshot();
    });

    it('should have BlocxChips Variant 1 component', function () {
        const wrapper = shallow(<BlocxChips  value={chips1}
        placeholder="Add a tag..."
        data={items}
        type="Input"/>);
        expect(wrapper).toBeTruthy();
    });

    it('variant 1: invokes `componentDidMount` when mounted', function () {
        jest.spyOn(BlocxChips.prototype, 'componentDidMount');
        shallow(<BlocxChips  value={chips1}
        placeholder="Add a tag..."
        data={items}
        type="Input"/>);
        expect(BlocxChips.prototype.componentDidMount).toBeDefined();
        BlocxChips.prototype.componentDidMount.mockRestore();
    });

    it('variant 1: calls `setChips` when mounted', () => {
        const wrapper = shallow(<BlocxChips  value={chips1}
        placeholder="Add a tag..."
        data={items}
        type="Input"/>);
        const instance = wrapper.instance();
        jest.spyOn(instance, 'setChips');
        instance.componentDidMount();
        expect(instance.setChips).toBeDefined();
    });

    it('variant 1: should trigger onKeyDown event when when backspace is pressed', function () {
        const onKeyDown = jest.fn();
        const wrapper = shallow(<BlocxChips  value={chips1}
        placeholder="Add a tag..."
        data={items}
        type="Input"/>);
        wrapper.find('.blocx-autocomplete_input').simulate('keyDown', {keyPressed: 8});
        wrapper.update();
        expect(onKeyDown).toBeDefined();
    });

    it('variant 1: should trigger onKeyDown event when enter key is pressed', function () {
        const onKeyDown = jest.fn();
        const wrapper = shallow(<BlocxChips  value={chips1}
        placeholder="Add a tag..."
        data={items}
        type="Input"/>);
        wrapper.find('.blocx-autocomplete_input').simulate('keyDown', { key: 'Enter', keyCode: 13 });
        wrapper.update();
        expect(onKeyDown).toBeDefined();
    });

    it('variant 1: should trigger onKeyDown event when up arrow is pressed', function () {
        const onKeyDown = jest.fn();
        const wrapper = shallow(<BlocxChips  value={chips1}
        placeholder="Add a tag..."
        data={items}
        type="Input"/>);
        wrapper.find('.blocx-autocomplete_input').simulate('keyDown', { keyCode: 38 });
        wrapper.update();
        expect(onKeyDown).toBeDefined();
    });

    it('variant 1: should trigger onKeyDown event when down arrow is pressed', function () {
        const onKeyDown = jest.fn();
        const wrapper = shallow(<BlocxChips  value={chips1}
        placeholder="Add a tag..."
        data={items}
        type="Input"/>);
        wrapper.find('.blocx-autocomplete_input').simulate('keyDown', { keyCode: 40 });
        wrapper.update();
        expect(onKeyDown).toBeDefined();
    });

    it('variant 1: should trigger img onClick event when a chip is deleted from chips1 data array', function () {
        const deleteChip = jest.fn();
        const wrapper = mount(<BlocxChips  value={chips1}
        placeholder="Add a tag..."
        data={items}
        type="Input"/>);
        expect(chips1.length).toBe(3)
        wrapper.find('.blocx-chips_close-btn').at(1).simulate('click');
        expect(chips1.length).toBe(2)
        wrapper.update();
        expect(deleteChip).toBeDefined();
    });

    it('variant 1: should trigger onChange event when a chips is added by `j` keyword input and first suggestion is selected from the list', function () {
        const onChange = jest.fn();
        const wrapper = mount(<BlocxChips value={chips1}
            placeholder="Add a tag..."
            data={items}
            type="Input"/>);
        wrapper.find('.blocx-autocomplete_input').simulate('change', { currentTarget: { value: 'j' } });
        wrapper.setState({userInput: 'j'});
        wrapper.find('li').at(0).simulate('click', { target: { value: 'Javascript' } });
        wrapper.update();
        expect(onChange).toBeDefined();
    });

    let chips2 = [
        {id:1,value:'Soft', isSelected:false},
        {id:2,value:'Medium',isSelected:true},
        {id:3,value:'Hard',isSelected:false},
        {id:4,value:'Very Hard',isSelected:false}
    ]

    it('renders correctly [BlocxChips Variant 2]', function () {
        const wrapper = renderer.create(<BlocxChips data={chips2}
            type="Choice"/>).toJSON();
        expect(wrapper).toMatchSnapshot();
    });

    it('should have BlocxChips Variant 2 component', function () {
        const wrapper = shallow(<BlocxChips data={chips2}
            type="Choice"/>);
        expect(wrapper).toBeTruthy();
    });

    it('variant 2: should trigger selectChoiceChip event when value = soft is selected', function () {
        const selectChoiceChip = jest.fn();
        const wrapper = shallow(<BlocxChips onClick = {selectChoiceChip}
            data={chips2}
            type="Choice"/>);
        expect(chips2[0].isSelected).toBe(false);
        expect(chips2[1].isSelected).toBe(true);
        wrapper.find('.blocx-chips_choice-wrapper').first().simulate('click');
        expect(chips2[0].isSelected).toBe(true);
        expect(chips2[1].isSelected).toBe(false);
        expect(selectChoiceChip).toBeDefined();
    });

    let chips3 = [
        {id:1,value:'Balcony', isSelected:true},
        {id:2,value:'Elevator',isSelected:false},
        {id:3,value:'Fireplace',isSelected:false},
        {id:4,value:'Car Parking',isSelected:false}
    ]

    it('renders correctly [BlocxChips Variant 3]', function () {
        const wrapper = renderer.create(<BlocxChips data={chips3}
            type="Filter"/>).toJSON();
        expect(wrapper).toMatchSnapshot();
    });

    it('should have BlocxChips Variant 3 component', function () {
        const wrapper = shallow(<BlocxChips data={chips3}
            type="Filter"/>);
        expect(wrapper).toBeTruthy();
    });

    it('variant 3: should trigger onClick event when multiple chips is selected', function () {
        const selectFilterChip = jest.fn();
        const wrapper = shallow(<BlocxChips onClick = {selectFilterChip} data={chips3}
            type="Filter"/>);
        expect(chips3[0].isSelected).toBe(true);
        expect(chips3[1].isSelected).toBe(false);
        expect(chips3[2].isSelected).toBe(false);
        expect(chips3[3].isSelected).toBe(false);
        wrapper.find('.blocx-chips_filter-wrapper').at(1).simulate('click');
        console.log('chips3',chips3)
        expect(chips3[0].isSelected).toBe(true);
        expect(chips3[1].isSelected).toBe(true);
        expect(chips3[2].isSelected).toBe(false);
        expect(chips3[3].isSelected).toBe(false);
        wrapper.update();
        expect(selectFilterChip).toBeDefined();
    });

    let chips4 = [
        {id:1,value:'Favorite', isSelected:true, iconClass:"fa fa-heart"},
        {id:2,value:'Bookmark',isSelected:false, iconClass:"fa fa-bookmark"}
    ]

    it('renders correctly [BlocxChips Variant 4]', function () {
        const wrapper = renderer.create(<BlocxChips data = {chips4}
            type="Action" />).toJSON();
        expect(wrapper).toMatchSnapshot();
    });

    it('should have BlocxChips Variant 4 component', function () {
        const wrapper = shallow(<BlocxChips data = {chips4}
            type="Action"/>);
        expect(wrapper).toBeTruthy();
    });

});
